IF OBJECT_ID('dbo.proc_transform_294', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_294;
GO
CREATE PROCEDURE dbo.proc_transform_294
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_294
    SET payload = LEFT(payload, 1000) + N'|V4-294|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_294;
END
